            <Avatar
              className="post__avatar"
              alt='username'
              src="/static/images/avatar/1.jpg"
              />
            <h3>Username</h3>
            </div>


            <img className="post__image" src="https://image.flaticon.com/icons/png/512/87/87390.png" 
            alt="" />
            <h4 className="post__text"><strong>Username</strong> caption</h4>



        </div>
    )
}

export default Post
